// src/components/TournamentList.js

import React, { useEffect, useState } from "react";
import axios from "axios";

export default function TournamentList({ onAdd, onEdit, onView }) {
  const [tournaments, setTournaments] = useState([]);
  const [loading, setLoading] = useState(true);
  const [err, setErr] = useState("");

  const token = localStorage.getItem("token");

  useEffect(() => {
    const fetchTournaments = async () => {
      setLoading(true);
      setErr("");
      try {
        const res = await axios.get("http://localhost:5000/api/tournaments", {
          headers: { Authorization: `Bearer ${token}` }
        });
        setTournaments(res.data || []);
      } catch (error) {
        setErr(error?.response?.data?.error || "Failed to load tournaments");
      }
      setLoading(false);
    };
    fetchTournaments();
  }, [token]);

  return (
    <div className="bg-white rounded-lg shadow p-6">
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-xl font-bold text-athletiq-navy">All Tournaments</h2>
        {onAdd && (
          <button
            className="px-4 py-2 bg-athletiq-green text-white rounded hover:bg-green-700 font-semibold"
            onClick={onAdd}
          >
            + Add Tournament
          </button>
        )}
      </div>
      {err && <div className="text-red-500 mb-2">{err}</div>}
      {loading ? (
        <div>Loading...</div>
      ) : tournaments.length === 0 ? (
        <div>No tournaments found.</div>
      ) : (
        <div className="overflow-x-auto">
          <table className="min-w-full text-sm">
            <thead>
              <tr className="bg-athletiq-blue text-white">
                <th className="p-2 text-left">Name</th>
                <th className="p-2 text-left">Sports</th>
                <th className="p-2 text-left">Level</th>
                <th className="p-2 text-left">Start Date</th>
                <th className="p-2 text-left">Status</th>
                <th className="p-2 text-left">Actions</th>
              </tr>
            </thead>
            <tbody>
              {tournaments.map(t => (
                <tr key={t.id} className="border-b last:border-none">
                  <td className="p-2">{t.name}</td>
                  <td className="p-2">
                    {(t.sports && Array.isArray(t.sports) ?
                      t.sports.map(s => s.name || s.id).join(", ")
                      : typeof t.sports === "string" ? t.sports : "")}
                  </td>
                  <td className="p-2">{t.level}</td>
                  <td className="p-2">{t.start_date?.slice(0, 10)}</td>
                  <td className="p-2">{t.status || "draft"}</td>
                  <td className="p-2 flex gap-2">
                    {onView && (
                      <button
                        className="bg-athletiq-blue text-white px-3 py-1 rounded hover:bg-athletiq-navy"
                        onClick={() => onView(t)}
                      >
                        View
                      </button>
                    )}
                    {onEdit && (
                      <button
                        className="bg-athletiq-green text-white px-3 py-1 rounded hover:bg-green-700"
                        onClick={() => onEdit(t)}
                      >
                        Edit
                      </button>
                    )}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}
